import React from 'react';
import { Route, Switch } from 'react-router-dom';
import './main.css';
import HomeScreen from './screens/HomeScreen';
import LoginScreen from './screens/LoginScreen';
import RestaurantsListScreen from './screens/RestaurantsListScreen';
import SignUpScreen from './screens/SignUpScreen';
import RestaurantDetails from './screens/RestaurantDetails';
import DonateScreen from './screens/users/DonateScreen';
import DonateServing from './screens/users/DonateServing';
import ProfileScreen from './screens/users/ProfileScreen';
import RestLoginScreen from './screens/restaurant/RestLoginScreen';

function App() {
  console.log(window.outerWidth)
  console.log(window.outerHeight)

  return (
    <div className="App">
      <Switch >
        <Route path='/' exact component={HomeScreen} />
        <Route path='/restaurants/:id' exact component={RestaurantDetails} />
        <Route path='/restaurants' component={RestaurantsListScreen} />
        <Route path='/login' component={LoginScreen} />
        <Route path='/signup' component={SignUpScreen} />
        <Route path='/donate/:id' component={DonateScreen} />
        <Route path='/donate-serving/:id' component={DonateServing} />
        <Route path='/profile' component={ProfileScreen} />
        <Route path='/rest/login' component={RestLoginScreen} />
        <Route path='/rest/profile' component={MySer} />
      </Switch>
    </div>
  );
}

export default App;
